function Card()
{
    return(
<div className="Draft">
    <img src="/IMG/image1.jpg" alt="Zawodnik"></img><br/>
    <div className="Draft-stats">
        <img src="IMG/image12.jpg" alt="Gwiazda"></img>
        <span>5.0</span>
        <span>(6) * </span>
        <span>USA</span>
    </div>
    <p>Life lesson with Katie Zaferson</p>
    <div className="Draft-pricing">
        <span><strong>From $136</strong></span>
        <span> / person</span>
    </div>

</div>

    )
}

export {Card}
